import React, { useState , useEffect } from 'react'
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import LandingPage from './components/LandingPage/LandingPage'; // Corrected path


function App() {

  return (
    <Router>
      <Header /> {/* Render the Header component at the top of all pages */}
      <Routes>
        <Route path="/" element={<Home />} /> {/* Add a Home component path (optional) */}
        <Route path="/find" element={<Find />} /> {/* Route for the Find page */}
      </Routes>
    </Router>
  )
}

export default App;
